import logoWhiteText from '../static/logoWhiteText.png';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import React, { memo, useState } from 'react';
import { CgProfile } from "react-icons/cg";
import { FaChevronDown } from "react-icons/fa";



const Header = memo(function Header({user}) {
  const location = useLocation();

  const navigate = useNavigate()
  const [isProfileOpen, setIsProfileOpen] = useState(false)

  // function to go to profile section
  // scroll to section when the link is clicked in the dropdown 
  const goToProfileSection = (sectionId) => {
    setIsProfileOpen(false)
    navigate('/profile')
    setTimeout(() => {
      const element = document.getElementById(sectionId);
      if (element) {
        element.scrollIntoView({ behavior: 'smooth', block: 'start' })
      }
    }, 100);
  };



  return (
    <header className="flex items-center justify-between bg-lime-900 px-4 sm:px-8 lg:px-12 h-20 sm:h-28">
        <div className="flex items-center">
        {(user === null  || user === undefined) ? (
          <Link to="/">
            <img className="w-32 h-16 sm:w-64 sm:h-60 object-contain" src={logoWhiteText} alt="logo" />
          </Link>) :( 
            <Link to="/dashboard">
            <img className="w-32 h-16 sm:w-64 sm:h-60 object-contain" src={logoWhiteText} alt="logo" />
          </Link>
          )}
        </div>
        <nav className="flex gap-2 sm:gap-4 lg:gap-8 pr-2 sm:pr-4">
          {(user === null  || user === undefined) ? (
            <>
            <Link to="/register" className="hidden sm:block text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold">Register</Link>
            <Link to="/login" className="hidden sm:block text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold ">Login</Link>
            <button 
              onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
              className="sm:hidden text-white text-xl"
            >
              {isMobileMenuOpen ? <FaTimes /> : <FaBars />}
            </button>
           </>

          ) : (
            <>
                <Link to="/dashboard" className="hidden sm:block text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold ">Dashboard</Link>
                <Link to="/whatif" className="hidden sm:block text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold ">Scenario Playground</Link>
                <Link to="/expenses"  className="hidden sm:block text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold ">Expenses</Link>
                <Link to="/goals" className="hidden sm:block text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold ">Goals</Link>
                <Link to="/savings" className="hidden sm:block text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold ">Savings</Link>
                <div className="relative">
                  <button
                    onClick={() => setIsProfileOpen(!isProfileOpen)}
                    className="hidden sm:block text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold"
                  >
                    <CgProfile className="inline text-2xl" /> <FaChevronDown className ="inline text-sm" />
                  </button>

                  {isProfileOpen && (
                    <div className="absolute right-0 mt-2 w-40 bg-white rounded shadow-lg py-1 z-50">
                      <Link
                        to="/profile"
                        onClick={() => setIsProfileOpen(false)}
                        className="block w-full text-center px-4 py-2 text-md font-semibold text-gray-700 hover:bg-gray-100">
                        Profile
                      </Link>
                      <button
                        onClick={() => goToProfileSection('income-section')}
                        className="block w-full text-center px-4 py-2 text-md font-semibold text-gray-700 hover:bg-gray-100">
                        Income
                      </button>
                      <button
                        onClick={() => goToProfileSection('fixed-expenses-section')}
                        className="block w-full text-center px-4 py-2 text-md font-semibold text-gray-700 hover:bg-gray-100">
                        Fixed Expenses
                      </button>

                    </div>
                  )}
                </div>
                <Link to="/logout" className="hidden sm:block text-white hover:text-gray-300 text-xs sm:text-sm lg:text-lg font-semibold ">Logout</Link>
                <button 
                  onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
                  className="sm:hidden text-white text-xl"
                >
                  {isMobileMenuOpen ? <FaTimes /> : <FaBars />}
                </button>
            </>
          )}
        </nav>

        {/* Mobile Menu Dropdown */}
        {isMobileMenuOpen && (
          <div className="absolute top-full left-0 right-0 bg-lime-900 border-t border-lime-800 sm:hidden z-50">
            <div className="px-4 py-2 space-y-2">
              {(user === null || user === undefined) ? (
                <>
                  <Link 
                    to="/register" 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className="block text-white hover:text-gray-300 text-sm font-semibold py-2"
                  >
                    Register
                  </Link>
                  <Link 
                    to="/login" 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className="block text-white hover:text-gray-300 text-sm font-semibold py-2"
                  >
                    Login
                  </Link>
                </>
              ) : (
                <>
                  <Link 
                    to="/dashboard" 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className="block text-white hover:text-gray-300 text-sm font-semibold py-2"
                  >
                    Dashboard
                  </Link>
                  <Link 
                    to="/whatif" 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className="block text-white hover:text-gray-300 text-sm font-semibold py-2"
                  >
                    Scenario Playground
                  </Link>
                  <Link 
                    to="/expenses" 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className="block text-white hover:text-gray-300 text-sm font-semibold py-2"
                  >
                    Expenses
                  </Link>
                  <Link 
                    to="/goals" 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className="block text-white hover:text-gray-300 text-sm font-semibold py-2"
                  >
                    Goals
                  </Link>
                  <Link 
                    to="/savings" 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className="block text-white hover:text-gray-300 text-sm font-semibold py-2"
                  >
                    Savings
                  </Link>
                  <Link 
                    to="/profile" 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className="block text-white hover:text-gray-300 text-sm font-semibold py-2"
                  >
                    Profile
                  </Link>
                  <Link 
                    to="/logout" 
                    onClick={() => setIsMobileMenuOpen(false)}
                    className="block text-white hover:text-gray-300 text-sm font-semibold py-2"
                  >
                    Logout
                  </Link>
                </>
              )}
            </div>
          </div>
        )}

    </header>
  );
});

export default Header;
